import React, { Component } from 'react';
import profile from '../profile.png';
import './Section.css';
import './About.css';

import { TopBar } from './Section';

class About extends Component {
    render() {
        return (
            <div className="section" id="About">
                <TopBar title='About'/>
                <div className="main">
                    <img src={profile}/>
                </div>
            </div>
        );
    }
}

export default About;
